import React, { useState } from 'react';
import Aside from './aside';
import '../css/mainView.css';
import threads from '../data/threads';


export default function Main() {

   return (
    <div className="main">
        <table>
            <tr>
                <td className="aside">
                <Aside />
                </td>
                <td className="feed">
                     {threads.map((thread) => <div> {thread.title} </div>)} 
                </td>
            </tr>
        </table>

    </div>
    );
}
